const diseaseFertilizerData = {
  Tomato: [
    {
      disease: "Leaf Curl Virus",
      symptoms: "Leaves curl and turn yellow",
      prevention: "Control whiteflies",
      fertilizer: "Zinc + Potash"
    },
    {
      disease: "Blight",
      symptoms: "Brown spots on leaves",
      prevention: "Avoid water stagnation",
      fertilizer: "Calcium Nitrate"
    }
  ],

  Cauliflower: [
    {
      disease: "Black Rot",
      symptoms: "Yellow V-shaped lesions",
      prevention: "Crop rotation",
      fertilizer: "Boron"
    }
  ],

  Onion: [
    {
      disease: "Purple Blotch",
      symptoms: "Purple spots on leaves",
      prevention: "Proper drainage",
      fertilizer: "Potash spray"
    }
  ]
};

export default diseaseFertilizerData;
